import React from 'react';
import Video from '../videos/video.mp4';
import {HeroContainer,HeroBg, VideoBg} from './'

function Home() {
    return (
        <HereContainer>
            <HeroBg>
                <VideoBg autoplay loopd muted src={video} type="video/mp4"/>
            </HeroBg>

        </HereContainer>
    )
}

export default Home;
